import React from "react";

function HelloDiv() {
  return (
    <div>
      <h1>Hello!<br></br>My name is Kervin!</h1>
      <ul>
        <li>Games</li>
        <li>Food</li>
        <li>Change the World</li>
      </ul>
    </div>
  );
}

export default HelloDiv;
